import React from 'react';
import Card from './Card';
import {robots} from './robots';

const CardList = () => {  
    const cardArray = robots.map((robot, i) => {
        return (
            <Card 
                key={i}
                id={robot[i].id} 
                name={robot[i].name} 
                email={robot[i].email}  />
        )
    });

    return (
        <div>
            {cardArray}
        </div>

    );
}

export default CardList;
